import React from "react";
import { Dimensions, View, TouchableOpacity, Text } from "react-native";

export default function BottomNavigation({ navigation }) {
  const btnStyle = {
    width: Dimensions.get("window").width / 2,
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    height: 65,
  };
  return (
    <View
      style={{
        width: Dimensions.get("window").width,
        position: "fixed",
        bottom: 0,
        left: 0,
        display: "flex",
        flexDirection: "row",
      }}
    >
      <TouchableOpacity style={btnStyle} onPress={() => navigation.navigator("HomeScreen")}>
        <Text>Home</Text>
      </TouchableOpacity>
      <TouchableOpacity style={btnStyle} onPress={() => navigation.navigator("HomeScreen")}>
        <Text>Account</Text>
      </TouchableOpacity>
    </View>
  );
}
